INSERT INTO `hbv_module_resource` VALUES ('<#include \"/utils/glueDocUtils.ftlx\">\n\n<alignment>\n	<name>${name}</name>\n	<renderedName>${getRenderedName()}</renderedName>\n<#if refSequence ??>\n	<constrainingReference>\n		<name>${refSequence.name}</name>\n		<renderedName>${refSequence.getRenderedName()}</renderedName>\n	</constrainingReference>\n</#if>\n<#if parent ??>\n	<parent>\n		<name>${parent.name}</name>\n		<renderedName>${parent.getRenderedName()}</renderedName>\n	</parent>\n</#if>\n<#list children as child>\n	<child glueType=\"Object[]\">\n		<name>${child.name}</name>\n		<renderedName>${child.getRenderedName()}</renderedName>\n	</child>\n</#list>\n</alignment>','hbvAlignmentRenderer','hbvAlignmentRenderer.ftlx'),('/**\n * This module generates various objects (reference sequences, module configs, alignments) based on a\n * single JSON file which defines the clade structure and reference sequence choices.\n * \n * The point of this is to have these choices in one place, so that they can be updated easily.\n */\n\n\n\nfunction getRefSeqName(alignmentObj, refSeqObj) {\n	return \"REF_\"+getCladeID(alignmentObj)+\"_\"+refSeqObj.sequenceID;\n}\n\nfunction getCladeID(alignmentObj) {\n	return alignmentObj.alignmentName.replace(\"AL_\", \"\");\n}\n\n\nfunction generateRefSeqNcbiImporter(ncbiImporterFile) {\n	\n	var cladeStructure = loadJsonCladeStructure();\n	\n	var refSeqImporterString = \n		\"<ncbiImporter>\\n\"+\n		\"  <sequenceFormat>GENBANK_XML</sequenceFormat>\\n\"+\n		\"  <specificPrimaryAccessions>\\n\"+\n	    \"    <primaryAccession>NC_003977</primaryAccession>\\n\"+ // master reference\n	    \"    <primaryAccession>X02763</primaryAccession>\\n\"; // suggested numbering reference\n\n	var sourceName = cladeStructure.referenceSourceName;\n	\n	visitStructureRefseqs(cladeStructure, function(refseq) {\n		refSeqImporterString += \n			\"    <primaryAccession>\"+refseq.sequenceID+\"</primaryAccession>\\n\"\n	});\n	\n	refSeqImporterString += \n		\"  </specificPrimaryAccessions>\\n\"+\n		\"  <sequenceIdField>PRIMARY_ACCESSION</sequenceIdField>\\n\"+\n		\"  <sourceName>\"+sourceName+\"</sourceName>\\n\"+\n		\"</ncbiImporter>\\n\";\n		\n	glue.command([\"file-util\", \"save-string\", refSeqImporterString, ncbiImporterFile]);\n}\n\nfunction createGlueReferenceSequences() {\n\n	glue.command([\"create\", \"reference\", \"REF_NUMBERING_X02763\", \"ncbi-refseqs\", \"X02763\"]);\n	\n	var cladeStructure = loadJsonCladeStructure();\n	var sourceName = cladeStructure.referenceSourceName;\n\n	\n	visitStructureAlignmentsPost(cladeStructure, function(alignment) {\n		var allRefs = [];\n		allRefs.push(alignment.constrainingRef);\n		if(alignment.referenceSequences != null) {\n			allRefs = allRefs.concat(alignment.referenceSequences);\n		}\n		allRefs = _.uniq(allRefs, function(refSeqObj) { return refSeqObj.sequenceID; });\n		_.each(allRefs, function(refSeqObj) {\n			var refSeqName = getRefSeqName(alignment, refSeqObj);\n			glue.command([\"create\", \"reference\", refSeqName, sourceName, refSeqObj.sequenceID]);\n\n			if(alignment.almtDisplayName != null) {\n				glue.inMode(\"reference/\"+refSeqName, function() {\n					glue.command([\"set\", \"field\", \"displayName\", alignment.almtDisplayName+\" Reference (\"+refSeqObj.sequenceID+\")\"]);\n				});\n			}\n		});\n	});\n\n}\n\nfunction pad(num, size) {\n    var s = num+\"\";\n    while (s.length < size) {\n    	s = \"0\" + s;\n    }\n    return s;\n}\n\nfunction createAlignmentTree() {\n\n	var cladeStructure = loadJsonCladeStructure();\n	var sourceName = cladeStructure.referenceSourceName;\n	var masterRefObj = cladeStructure.constrainingRef;\n	var masterRefName = getRefSeqName(cladeStructure, masterRefObj);\n	var masterAlmtName = cladeStructure.alignmentName;\n	glue.command([\"delete\", \"alignment\", masterAlmtName]);\n	glue.command([\"create\", \"alignment\", masterAlmtName, \"--refSeqName\", masterRefName]);\n	visitStructureAlignmentsPre(cladeStructure, function(alignment) {\n		glue.inMode(\"/alignment/\"+alignment.alignmentName, function() {\n			glue.command([\"set\", \"field\", \"clade_category\", alignment.cladeCategory]);\n			if(alignment.almtDisplayName != null) {\n				glue.command([\"set\", \"field\", \"displayName\", alignment.almtDisplayName]);\n				glue.command([\"set\", \"field\", \"minimal_name\", alignment.almtDisplayName.replace(\"Genotype \", \"\").replace(\"Subgenotype \", \"\")]);\n			}\n		});\n		if(alignment.childAlignments != null) {\n			_.each(alignment.childAlignments, function(childAlignment) {\n				glue.command([\"delete\", \"alignment\", childAlignment.alignmentName]);\n				glue.inMode(\"/alignment/\"+alignment.alignmentName, function() {\n					var childRefName = getRefSeqName(childAlignment, childAlignment.constrainingRef);\n					glue.command([\"add\", \"member\", \"--refName\", childRefName]);\n					glue.command([\"extract\", \"child\", childAlignment.alignmentName, \"--refName\", childRefName]);\n					// this demote member command is just to get the referenceMember flag set to true on the member\n					// in the parent alignment.\n					glue.command([\"demote\", \"member\", childAlignment.alignmentName, \"--member\", sourceName, childAlignment.constrainingRef.sequenceID]);\n\n				});\n			});\n		}\n		if(alignment.referenceSequences != null) {\n			_.each(alignment.referenceSequences, function(refObj) {\n				glue.inMode(\"/alignment/\"+alignment.alignmentName, function() {\n					glue.command([\"add\", \"member\", sourceName, refObj.sequenceID]);\n				});\n			});\n		}\n		glue.inMode(\"/alignment/\"+alignment.alignmentName, function() {\n			glue.command([\"derive\", \"segments\", \"AL_UNCONSTRAINED\", \"--existingMembersOnly\", \"--allMembers\"]);\n		});\n			\n	});\n\n}\n\n\nfunction loadJsonCladeStructure() {\n	var loadedString = \n		glue.command([\"file-util\", \"load-string\", \"json/clade_structure_and_refs.json\"]).fileUtilLoadStringResult.loadedString;\n	return JSON.parse(loadedString);\n}\n\n// visit all refseq objects in post-order fashion\nfunction visitStructureRefseqs(structureNode, refseqCallback) {\n	if(structureNode.childAlignments != null) {\n		_.each(structureNode.childAlignments, function(childAlignment) {\n			visitStructureRefseqs(childAlignment, refseqCallback);\n		});\n	}\n	if(structureNode.referenceSequences != null) {\n		_.each(structureNode.referenceSequences, refseqCallback);\n	}\n}\n\n//visit all alignment objects in post-order fashion\nfunction visitStructureAlignmentsPost(structureNode, alignmentCallback) {\n	if(structureNode.childAlignments != null) {\n		_.each(structureNode.childAlignments, function(childAlignment) {\n			visitStructureAlignmentsPost(childAlignment, alignmentCallback);\n		});\n	}\n	alignmentCallback(structureNode);\n}\n\n//visit all alignment objects in pre-order fashion\nfunction visitStructureAlignmentsPre(structureNode, alignmentCallback) {\n	alignmentCallback(structureNode);\n	if(structureNode.childAlignments != null) {\n		_.each(structureNode.childAlignments, function(childAlignment) {\n			visitStructureAlignmentsPre(childAlignment, alignmentCallback);\n		});\n	}\n}\n','hbvCladeStructureProcessor','hbvCladeStructureProcessor.js'),('svg {\n	font-family: Arial, Helvetica, sans-serif;\n}\n\n.codonLabel {\n    text-anchor: middle;\n	fill: #222222;\n}\n\n.referenceAaBackground {\n	fill: #ddeeff;\n}\n\n.referenceAa {\n    text-anchor: middle;\n	font-weight: bold;\n	fill: #3a5c7e;\n}\n\n.referenceNt {\n    text-anchor: middle;\n	font-weight: bold;\n	fill: #88aacc;\n	font-size: 90%;\n}\n\n.referenceNtIndexSegmentEnd {\n	text-anchor: left;\n	fill: #88aacc;\n	font-size: 90%;\n	font-weight: bold;\n}\n\n.referenceNtIndexRegular {\n	text-anchor: left;\n	fill: #88aacc;\n	font-size: 90%;\n}\n\n.queryAaBackground {\n	fill: #ddeecc;\n}\n\n.queryAa {\n    text-anchor: middle;\n	font-weight: bold;\n	fill: #557733;\n}\n\n.queryAaDiff {\n	text-anchor: middle;\n	font-weight: bold;\n	fill: #ffffff;\n}\n\n.multipleAas {\n	text-decoration: underline;\n}\n\n.multipleAas:hover {\n	fill: #ffffff;\n}\n\n.multipleAasBackground {\n	fill: #aaaaaa;\n}\n\n.multipleAasBackground:hover {\n	fill: #777777;\n}\n\n.queryAaDiffBackground {\n	fill: #aaaaaa;\n}\n\n.queryNt {\n    text-anchor: middle;\n	font-weight: bold;\n	fill: #99bb77;\n	font-size: 90%;\n}\n\n.queryNtDiff {\n	text-anchor: middle;\n	font-weight: bold;\n	fill: #ffffff;\n	font-size: 90%;\n}\n\n.queryNtDiffBackground {\n	fill: #aaaaaa;\n}\n\n.queryNtIndexSegmentEnd {\n	text-anchor: left;\n	fill: #99bb77;\n	font-size: 90%;\n	font-weight: bold;\n}\n\n.queryNtIndexRegular {\n	text-anchor: left;\n	fill: #99bb77;\n	font-size: 90%;\n}\n','hbvFeatureToSvgTransformer','hbvFeatureToSvgTransformer.css'),('<#assign alignmentNtColumns = transformerInput.featureVisualisation.displayNtWidth>\n\n<#assign ntWidthPx = transformerInput.ntWidth>\n<#assign ntHeightPx = ntWidthPx>\n<#assign ntSpacingPx = ntWidthPx / 4>\n<#assign aaHeightPx = ntWidthPx * 1.5>\n<#assign linkingHeightPx = aaHeightPx / 4>\n<#assign ntIndexHeightPx = ntWidthPx * 2.5>\n<#assign rowSpacingPx = ntSpacingPx * 1.5>\n\n<#assign svgWidthPx = ( alignmentNtColumns * ntWidthPx ) + ( (alignmentNtColumns-1) * ntSpacingPx) >\n\n<#assign detailAnnotationsList = []>\n\n\n<#list transformerInput.featureVisualisation.annotationRows as annotationRow>\n	<#switch annotationRow.annotationType>\n	  <#case \"codonLabel\">\n		<#assign codonLabelAnnotations = (annotationRow.annotations)![]>\n	    <#break>\n	  <#case \"refAa\">\n		<#assign refAaAnnotations = (annotationRow.annotations)![]>\n	    <#break>\n	  <#case \"refNtContent\">\n		<#assign refNtContentAnnotations = (annotationRow.annotations)![]>\n	    <#break>\n	  <#case \"refNtIndex\">\n		<#assign refNtIndexAnnotations = (annotationRow.annotations)![]>\n	    <#break>\n	  <#case \"queryAa\">\n		<#assign queryAaAnnotations = (annotationRow.annotations)![]>\n	    <#break>\n	  <#case \"queryNtContent\">\n		<#assign queryNtContentAnnotations = (annotationRow.annotations)![]>\n	    <#break>\n	  <#case \"queryNtIndex\">\n		<#assign queryNtIndexAnnotations = (annotationRow.annotations)![]>\n	    <#break>\n	  <#case \"detail\">\n	    <#if annotationRow.annotations ??>\n		<#assign detailAnnotationsList = detailAnnotationsList + [ annotationRow.annotations ]>\n		</#if>\n	    <#break>\n	  <#default>\n	</#switch>\n</#list>\n\n<#assign svgHeightPx = \n	aaHeightPx + <#-- codon label -->\n	aaHeightPx + <#-- ref AA -->\n	ntHeightPx + <#-- ref NT content -->\n	rowSpacingPx +\n	ntIndexHeightPx + <#-- ref NT index -->\n	rowSpacingPx +\n	aaHeightPx + <#-- query AA -->\n	ntHeightPx + <#-- query NT content -->\n	rowSpacingPx +\n	ntIndexHeightPx + <#-- query NT index -->\n	( detailAnnotationsList?size * (rowSpacingPx + aaHeightPx) )> <#-- detail rows -->\n\n\n<svg width=\"${svgWidthPx?c}\" height=\"${svgHeightPx?c}\"\n     xmlns=\"http://www.w3.org/2000/svg\">\n  <style>${getResourceAsString(\'hbvFeatureToSvgTransformer.css\')?no_esc}</style>\n  \n  <#assign y = 0>\n  \n  <#list codonLabelAnnotations as annotation>\n	  <#assign labelWidthPx = ( annotation.ntWidth * ntWidthPx ) + ( (annotation.ntWidth-1) * ntSpacingPx) >\n	  <#assign labelXPx = (labelWidthPx / 2) + ( (annotation.displayNtPos - 1) * (ntWidthPx + ntSpacingPx))>\n	  <#assign labelHeightPx = aaHeightPx>\n	  <#assign labelYPx = y + (labelHeightPx / 2)>\n	  <text class=\"codonLabel\" \n	  	x=\"${labelXPx?c}\" y=\"${labelYPx?c}\" width=\"${labelWidthPx?c}\" height=\"${labelHeightPx?c}\" dy=\".35em\">${annotation.label}</text>\n  </#list>\n\n  <#assign y = y + aaHeightPx>\n      \n  <#list refAaAnnotations as annotation>\n	  <#assign refAaRectWidthPx = ( annotation.ntWidth * ntWidthPx ) + ( (annotation.ntWidth-1) * ntSpacingPx) >\n	  <#assign refAaRectXPx = ( (annotation.displayNtPos - 1) * (ntWidthPx + ntSpacingPx))>\n	  <#assign refAaRectHeightPx = aaHeightPx>\n	  <#assign refAaRectYPx = y>\n	  \n	  <rect class=\"referenceAaBackground\" \n	  	x=\"${refAaRectXPx?c}\" y=\"${refAaRectYPx?c}\" width=\"${refAaRectWidthPx?c}\" height=\"${refAaRectHeightPx?c}\"></rect>\n	  \n	  <#assign refAaXPx = refAaRectXPx + (refAaRectWidthPx/2) >\n	  <#assign refAaYPx = refAaRectYPx + (aaHeightPx / 2)>\n	\n	  <text class=\"referenceAa\" \n	  	x=\"${refAaXPx?c}\" y=\"${refAaYPx?c}\" dy=\".35em\">${annotation.aa}</text> \n  </#list>\n\n  <#assign y = y + aaHeightPx>\n\n  <#list refNtContentAnnotations as annotation>\n\n	  <#assign refNtContentYPx = y + (ntHeightPx/2)>\n	  \n	  <#list 0..(annotation.ntContent?length-1) as charIndex>\n		  <#assign refNtContentXPx = ( ((annotation.displayNtPos - 1) + charIndex) * (ntWidthPx + ntSpacingPx) ) + (ntWidthPx / 2) >\n		  <text class=\"referenceNt\" \n		  	x=\"${refNtContentXPx?c}\" y=\"${refNtContentYPx?c}\" dy=\".35em\">${annotation.ntContent[charIndex]}</text> \n	  </#list>\n  </#list>\n\n  <#assign y = y + ntHeightPx + rowSpacingPx>\n\n  <#list refNtIndexAnnotations as annotation>\n\n	  <#assign refNtIndexYPx = y >\n	  <#assign refNtIndexXPx = ( ((annotation.displayNtPos - 1)) * (ntWidthPx + ntSpacingPx) ) + (ntWidthPx / 2) >\n	  \n	  <#assign indexClass = \"referenceNtIndexRegular\">\n	  <#if annotation.endOfSegment>\n		  <#assign indexClass = \"referenceNtIndexSegmentEnd\">\n	  </#if>\n\n	  <text class=\"${indexClass}\" \n		  	x=\"${refNtIndexXPx?c}\" y=\"${refNtIndexYPx?c}\" dy=\".35em\" transform=\'rotate(90 ${refNtIndexXPx?c} ${refNtIndexYPx?c})\'>${annotation.ntIndex?c}</text> \n  </#list>\n\n  <#assign y = y + ntIndexHeightPx + rowSpacingPx>\n\n  <#list queryAaAnnotations as annotation>\n\n	  <#if annotation.multipleAas??>\n	  <g class=\"multipleAasBackground\">\n	  <title>Multiple residues: ${annotation.multipleAas?join(\', \')}</title>\n	  </#if>\n\n	  <#assign queryAaRectWidthPx = ( annotation.ntWidth * ntWidthPx ) + ( (annotation.ntWidth-1) * ntSpacingPx) >\n	  <#assign queryAaRectXPx = ( (annotation.displayNtPos - 1) * (ntWidthPx + ntSpacingPx))>\n	  <#assign queryAaRectHeightPx = aaHeightPx>\n	  <#assign queryAaRectYPx = y>\n	  \n	  <#assign rectClass = \"queryAaBackground\">\n	  <#assign letterClass = \"queryAa\">\n	  \n	  <#if annotation.differentFromRef?? && annotation.differentFromRef>\n		  <#assign rectClass = \"queryAaDiffBackground\">\n		  <#assign letterClass = \"queryAaDiff\">\n	  </#if>\n\n	  <#assign displayedAa = annotation.aa>\n	\n	  <#if annotation.multipleAas??>\n		  <#assign displayedAa = \'?\'>\n		  <#assign letterClass = letterClass+\" multipleAas\">\n		  <#assign rectClass = \"\">\n	  </#if>\n	  \n	  <rect class=\"${rectClass}\" \n	  	x=\"${queryAaRectXPx?c}\" y=\"${queryAaRectYPx?c}\" width=\"${queryAaRectWidthPx?c}\" height=\"${queryAaRectHeightPx?c}\"></rect>\n	  \n	  <#assign queryAaXPx = queryAaRectXPx + (queryAaRectWidthPx/2) >\n	  <#assign queryAaYPx = queryAaRectYPx + (aaHeightPx / 2)>\n	\n	  <text class=\"${letterClass}\" \n	  	x=\"${queryAaXPx?c}\" y=\"${queryAaYPx?c}\" dy=\".35em\">${displayedAa}\n	  </text>\n	  \n	  <#if annotation.multipleAas??>\n	  </g>\n	  </#if>\n \n  </#list>\n\n  <#assign y = y + aaHeightPx>\n\n  <#list queryNtContentAnnotations as annotation>\n\n	  <#assign queryNtContentYPx = y + (ntHeightPx/2)>\n	  \n	  <#if annotation.ntDisplayPosDifferences??>\n		  <#assign differencePositions = annotation.ntDisplayPosDifferences>\n	  <#else>\n		  <#assign differencePositions = []>\n	  </#if>  \n	  \n	  <#list 0..(annotation.ntContent?length-1) as charIndex>\n	  	  <#assign ntPos = annotation.displayNtPos + charIndex>\n		  <#assign queryNtContentXPx = ( ( ntPos - 1 ) * (ntWidthPx + ntSpacingPx) ) + (ntWidthPx / 2) >\n\n		  <#assign class = \"queryNt\">\n		  <#if ((differencePositions?size) > 0) && (ntPos == differencePositions?first)>\n		      <#assign differencePositions = differencePositions[1..]>\n			  <#assign class = \"queryNtDiff\">	\n		      <#assign queryNtRectXPx = ( ( ntPos - 1 ) * (ntWidthPx + ntSpacingPx) )>\n		      <#assign queryNtRectYPx = y>\n		      <#assign queryNtRectWidthPx = ntWidthPx>\n		      <#assign queryNtRectHeightPx = ntHeightPx>\n			  <rect class=\"queryNtDiffBackground\" \n			  	x=\"${queryNtRectXPx?c}\" y=\"${queryNtRectYPx?c}\" width=\"${queryNtRectWidthPx?c}\" height=\"${queryNtRectHeightPx?c}\"></rect>\n		  </#if>\n		  \n		  <text class=\"${class}\" \n		  	x=\"${queryNtContentXPx?c}\" y=\"${queryNtContentYPx?c}\" dy=\".35em\">${annotation.ntContent[charIndex]}</text> \n	  </#list>\n  </#list>\n\n  <#assign y = y + ntHeightPx + rowSpacingPx>\n\n  <#list queryNtIndexAnnotations as annotation>\n\n	  <#assign queryNtIndexYPx = y>\n	  <#assign queryNtIndexXPx = ( ((annotation.displayNtPos - 1)) * (ntWidthPx + ntSpacingPx) ) + (ntWidthPx / 2) >\n	  \n	  <#assign indexClass = \"queryNtIndexRegular\">\n	  <#if annotation.endOfSegment>\n		  <#assign indexClass = \"queryNtIndexSegmentEnd\">\n	  </#if>\n	  \n	  <text class=\"${indexClass}\" \n		  	x=\"${queryNtIndexXPx?c}\" y=\"${queryNtIndexYPx?c}\" dy=\".35em\" transform=\'rotate(90 ${queryNtIndexXPx?c} ${queryNtIndexYPx?c})\'>${annotation.ntIndex?c}</text> \n  </#list>\n</svg>\n','hbvFeatureToSvgTransformer','hbvFeatureToSvgTransformer.ftlx'),('\nvar featuresList = [\n		             { name: \"PRE_C\",\n		            	 displayName: \"Pre-C\"\n		             },\n		             { name: \"C\",\n		            	 displayName: \"C\"\n		             },\n		             { name: \"P\",\n		            	 displayName: \"P\"\n		             },\n		             { name: \"RT\",\n		            	 displayName: \"RT\"\n		             },\n		             { name: \"PRE_S1\",\n		            	 displayName: \"Pre-S1\"\n		             },\n		             { name: \"PRE_S2\",\n		            	 displayName: \"Pre-S2\"\n		             },\n		             { name: \"S\",\n		            	 displayName: \"S\"\n		             },\n		             { name: \"X\",\n		            	 displayName: \"X\"\n		             }\n		];\n\nfunction reportFastaWeb(base64, filePath) {\n	glue.log(\"FINE\", \"hbvReportingController.reportFastaWeb invoked\");\n	var fastaDocument;\n	glue.inMode(\"module/hbvFastaUtility\", function() {\n		fastaDocument = glue.command([\"base64-to-nucleotide-fasta\", base64]);\n	});\n	var numSequencesInFile = fastaDocument.nucleotideFasta.sequences.length;\n	if(numSequencesInFile == 0) {\n		throw new Error(\"No sequences found in FASTA file\");\n	}\n	var maxSequencesWithoutAuth = 50;\n	if(numSequencesInFile > maxSequencesWithoutAuth && !glue.hasAuthorisation(\"hbvFastaAnalysisLargeSubmissions\")) {\n		throw new Error(\"Not authorised to analyse FASTA files with more than \"+maxSequencesWithoutAuth+\" sequences\");\n	}\n	result = reportDocument({\n		reportFastaDocument: {\n			\"fastaDocument\": fastaDocument, \n			\"filePath\": filePath\n		}\n	});\n	glue.setRunningDescription(\"Collating report\");\n	return result;\n}\n\nfunction reportDocument(document) {\n	var filePath = document.reportFastaDocument.filePath;\n	var fastaDocument = document.reportFastaDocument.fastaDocument;\n	var fastaMap = {};\n	var resultMap = {};\n	var placerResultContainer = {};\n	// apply blast recogniser / genotyping together on set, as this is more efficient.\n	initResultMap(fastaDocument, fastaMap, resultMap, placerResultContainer);\n	// apply report generation to each sequence in the set.\n	var hbvReports = _.map(fastaDocument.nucleotideFasta.sequences, function(sequence) {\n		return generateSingleFastaReport(_.pick(fastaMap, sequence.id), _.pick(resultMap, sequence.id), filePath);\n	});\n	var result = {\n		hbvWebReport:  { \n			results: hbvReports, \n			placerResult: placerResultContainer.placerResult\n		}\n	};\n\n	glue.log(\"FINE\", \"hbvReportingController.reportFastaWeb result\", result);\n	\n	return result;\n}\n\n/**\n * Entry point for generating a report for a fasta file containing a single sequence.\n */\nfunction reportFasta(fastaFilePath) {\n	glue.log(\"FINE\", \"hbvReportingController.reportFasta invoked, input file:\"+fastaFilePath);\n	// Load fasta and put in a fastaMap\n	var fastaDocument;\n	glue.inMode(\"module/hbvFastaUtility\", function() {\n		fastaDocument = glue.command([\"load-nucleotide-fasta\", fastaFilePath]);\n	});\n	var numSequencesInFile = fastaDocument.nucleotideFasta.sequences.length;\n	if(numSequencesInFile == 0) {\n		throw new Error(\"No sequences found in FASTA file\");\n	}\n	if(numSequencesInFile > 1) {\n		throw new Error(\"Please use only one sequence per FASTA file\");\n	}\n	var fastaMap = {};\n	var resultMap = {};\n	var placerResultContainer = {};\n	initResultMap(fastaDocument, fastaMap, resultMap, placerResultContainer);\n	var singleFastaReport = generateSingleFastaReport(fastaMap, resultMap, fastaFilePath);\n	singleFastaReport.hbvReport[\"placerResult\"] = placerResultContainer.placerResult;\n	return singleFastaReport;\n}\n\nfunction initResultMap(fastaDocument, fastaMap, resultMap, placerResultContainer) {\n	glue.log(\"FINE\", \"hbvReportingController.initResultMap fastaDocument:\", fastaDocument);\n	_.each(fastaDocument.nucleotideFasta.sequences, function(sequenceObj) {\n		fastaMap[sequenceObj.id] = sequenceObj;\n	});\n	// initialise result map.\n	var sequenceObjs = _.values(fastaMap);\n	_.each(sequenceObjs, function(sequenceObj) {\n		resultMap[sequenceObj.id] = { id: sequenceObj.id };\n	});\n	\n	// apply recogniser to fastaMap\n	recogniseFasta(fastaMap, resultMap);\n\n	// apply rotator to fastaMap\n	rotateFasta(fastaMap, resultMap);\n\n	\n	glue.log(\"FINE\", \"hbvReportingController.initResultMap, result map after recogniser\", resultMap);\n\n	// apply genotyping\n	genotypeFasta(fastaMap, resultMap, placerResultContainer);\n\n	glue.log(\"FINE\", \"hbvReportingController.initResultMap, result map after genotyping\", resultMap);\n}\n\nfunction rotateFasta(fastaMap, resultMap) {\n	var rotationFastaMap = {};\n	_.each(_.values(resultMap), function(resultObj) {\n		if(resultObj.isForwardHbv && !resultObj.isReverseHbv) {\n			rotationFastaMap[resultObj.id] = fastaMap[resultObj.id];\n		} \n	});\n	if(!_.isEmpty(rotationFastaMap)) {\n		var numSeqs = _.values(rotationFastaMap).length;\n		glue.setRunningDescription(\"Rotation for \"+numSeqs+\" sequence\"+((numSeqs > 1) ? \"s\" : \"\"));\n\n		var rotationResultObjs;\n		glue.inMode(\"module/hbvBlastSequenceRotator\", function() {\n			rotationResultObjs = glue.tableToObjects(glue.command({\n				\"rotate\": {\n					\"fasta-document\": {\n						\"fastaCommandDocument\": {\n							\"nucleotideFasta\" : {\n								\"sequences\": _.values(rotationFastaMap)\n							}\n						}\n					}\n				}\n			}));\n		});\n		_.each(rotationResultObjs, function(rotationResultObj) {\n			resultMap[rotationResultObj.querySequenceId].rotationStatus = rotationResultObj.status;\n			resultMap[rotationResultObj.querySequenceId].rotationNts = rotationResultObj.rotationNts;\n			if(rotationResultObj.status == \"ROTATION_NECESSARY\") {\n				resultMap[rotationResultObj.querySequenceId].rotationSuccess = true;\n				var seq = fastaMap[rotationResultObj.querySequenceId].sequence;\n				fastaMap[rotationResultObj.querySequenceId].sequence = rightRotate(seq, rotationResultObj.rotationNts);\n			} else if(rotationResultObj.status == \"NO_ROTATION_NECESSARY\") {\n				resultMap[rotationResultObj.querySequenceId].rotationSuccess = true;\n			} else {\n				resultMap[rotationResultObj.querySequenceId].rotationSuccess = false;\n			}\n		});\n\n	}\n}\n\n\n// rotates s towards left by d  \nfunction leftRotate(str, d) { \n	return str.slice(d) + str.slice(0, d); \n} \n\n// rotates s towards right by d  \nfunction rightRotate(str, d) { \n	return leftRotate(str, str.length() - d); \n} \n\nfunction generateQueryToTargetRefSegs(targetRefName, nucleotides) {\n	var alignerModule;\n	glue.inMode(\"module/hbvFastaSequenceReporter\", function() {\n		alignerModule = glue.command([\"show\", \"property\", \"alignerModuleName\"]).moduleShowPropertyResult.propertyValue;\n	});\n	var alignResult;\n	glue.inMode(\"module/\"+alignerModule, function() {\n		alignResult = glue.command({align: {\n				referenceName: targetRefName,\n				sequence: [\n				    { \n				    	queryId: \"query\", \n				    	n