	});\n		glue.log(\"FINE\", \"hbvReportingController.genotypeFasta genotypingResults:\", genotypingResults);\n		_.each(genotypingResults, function(genotypingResult) {\n			genotypingResult.genotypeCategoryResult = _.find(genotypingResult.queryCladeCategoryResult, \n					function(cladeCategoryResult) { return cladeCategoryResult.categoryName == \"genotype\"; });\n			genotypingResult.subgenotypeCategoryResult = _.find(genotypingResult.queryCladeCategoryResult, \n					function(cladeCategoryResult) { return cladeCategoryResult.categoryName == \"subgenotype\"; });\n			if(genotypingResult.genotypeCategoryResult.finalCladeRenderedName == null) {\n				genotypingResult.genotypeCategoryResult.shortRenderedName = \"Unknown\";\n			} else {\n				genotypingResult.genotypeCategoryResult.shortRenderedName = \n					genotypingResult.genotypeCategoryResult.finalCladeRenderedName;\n			}\n			if(genotypingResult.subgenotypeCategoryResult.finalCladeRenderedName == null) {\n				var genotypeHasChildren = false;\n				if(genotypingResult.genotypeCategoryResult.finalClade != null) {\n					glue.inMode(\"alignment/\"+genotypingResult.genotypeCategoryResult.finalClade, function() {\n						var numChildren = glue.tableToObjects(glue.command([\"list\", \"children\"])).length;\n						genotypeHasChildren = numChildren > 0;\n					});\n				}\n				if(genotypeHasChildren) {\n					genotypingResult.subgenotypeCategoryResult.shortRenderedName = \"Unknown\";\n				} else {\n					genotypingResult.subgenotypeCategoryResult.shortRenderedName = \"N/A\";\n				}\n			} else {\n				genotypingResult.subgenotypeCategoryResult.shortRenderedName = \n					genotypingResult.subgenotypeCategoryResult.finalCladeRenderedName;\n			}\n			glue.log(\"FINE\", \"hbvReportingController.genotypeFasta genotypeCategoryResult\", genotypingResult.genotypeCategoryResult);\n			glue.log(\"FINE\", \"hbvReportingController.genotypeFasta subgenotypeCategoryResult\", genotypingResult.subgenotypeCategoryResult);\n			\n			\n			resultMap[genotypingResult.queryName].genotypingResult = genotypingResult;\n		});\n	}\n}\n\n/*\n * Use the fastaUtility module to reverse complement a FASTA string\n */\nfunction reverseComplement(fastaString) {\n	var reverseComplement;\n	glue.inMode(\"module/hbvFastaUtility\", function() {\n		var reverseComplementResult = \n			glue.command([\"reverse-complement\", \"string\", \n			              \"--fastaString\", fastaString]);\n		reverseComplement = reverseComplementResult.reverseComplementFastaResult.reverseComplement;\n	});\n	return reverseComplement;\n}\n\n/*\n * This function takes a fastaMap of id -> { id, nucleotideFasta }, and a result map of id -> ? \n * and runs BLAST recogniser, to determine whether the sequence is HBV, and if so, whether \n * it is in the forward direction or reverse complement.\n * The result map will have isForwardHbv set to true if a forward hit was found, false otherwise\n * It will have isReverseHbv set to true if a reverse hit was found, false otherwise\n */\nfunction recogniseFasta(fastaMap, resultMap) {\n	var sequenceObjs = _.values(fastaMap);\n	_.each(_.values(resultMap), function(resultObj) {\n		resultObj.isForwardHbv = false;\n		resultObj.isReverseHbv = false;\n	});\n	var fastaDocument = {\n		\"nucleotideFasta\" : {\n			\"sequences\" : sequenceObjs\n		}\n	};\n	var numSeqs = sequenceObjs.length;\n	glue.setRunningDescription(\"Sequence recognition for \"+numSeqs+\" sequence\"+((numSeqs > 1) ? \"s\" : \"\"));\n	var recogniserResults;\n	glue.inMode(\"module/hbvSequenceRecogniser\", function() {\n		recogniserResults = glue.tableToObjects(glue.command({\n				\"recognise\": {\n					\"fasta-document\": {\n						\"fastaCommandDocument\": fastaDocument\n					}\n				}\n		}));\n	});\n	glue.log(\"FINE\", \"hbvReportingController.reportFasta recogniserResults:\", recogniserResults);\n	_.each(recogniserResults, function(recogniserResult) {\n		if(recogniserResult.direction == \'FORWARD\') {\n			resultMap[recogniserResult.querySequenceId].isForwardHbv = true;\n		} else if(recogniserResult.direction == \'REVERSE\') {\n			resultMap[recogniserResult.querySequenceId].isReverseHbv = true;\n		} \n	});\n}\n\nfunction addOverview(hbvReport) {\n	var today = new Date();\n	var dd = today.getDate();\n	var mm = today.getMonth()+1; // January is 0!\n	var yyyy = today.getFullYear();\n	if(dd < 10) {\n	    dd = \'0\'+dd\n	} \n	if(mm < 10) {\n	    mm = \'0\'+mm\n	} \n	hbvReport.hbvReport.reportGenerationDate = dd + \'/\' + mm + \'/\' + yyyy;\n	hbvReport.hbvReport.engineVersion = \n		glue.command([\"glue-engine\",\"show-version\"]).glueEngineShowVersionResult.glueEngineVersion;\n	hbvReport.hbvReport.projectVersion = \n		glue.command([\"show\",\"setting\",\"project-version\"]).projectShowSettingResult.settingValue;\n	\n}\n\n','hbvReportingController','hbvReportingController.js'),('<#include \"/utils/glueDocUtils.ftlx\">\n\n<sequence>\n	<sourceName>${source.name}</sourceName>\n	<sequenceID>${sequenceID}</sequenceID>\n<#list alignmentMemberships as alignmentMembership>\n	<alignmentMembership glueType=\"Object[]\">\n		<name>${alignmentMembership.alignment.name}</name>\n		<renderedName>${alignmentMembership.alignment.getRenderedName()}</renderedName>\n<#if alignmentMembership.alignment.refSequence ??>\n<#assign constrainingRefName=alignmentMembership.alignment.refSequence.name>\n		<constrainingReference>\n			<name>${constrainingRefName}</name>\n			<renderedName>${alignmentMembership.alignment.refSequence.getRenderedName()}</renderedName>\n		</constrainingReference>\n		<#list alignmentMembership.fLocNotes as fLocNote>\n		<#if fLocNote.featureLoc.referenceSequence.name = constrainingRefName>\n		<featureCoverage glueType=\"Object[]\">\n			<featureName>${fLocNote.featureLoc.feature.name}</featureName>\n			<featureRenderedName>${fLocNote.featureLoc.feature.getRenderedName()}</featureRenderedName>\n			<@elem tag=\"coveragePct\" expr=\"context.ref_nt_coverage_pct\" type=\"Double\" context=fLocNote/>\n		</featureCoverage>	\n		</#if>	\n		</#list>\n</#if>\n	</alignmentMembership>\n</#list>\n<#list referenceSequences as referenceSequence>\n	<referenceSequence glueType=\"Object[]\">\n		<name>${referenceSequence.name}</name>\n		<renderedName>${referenceSequence.getRenderedName()}</renderedName>\n	</referenceSequence>\n</#list>\n	<@elem tag=\"country\" expr=\"context.display_name\" context=m49_country/>\n	<@elem tag=\"country_iso\" expr=\"context.id\" context=m49_country/>\n<#if m49_country ??>\n	<@elem tag=\"m49_region\" expr=\"context.id\" context=m49_country.m49_region/>\n	<@elem tag=\"m49_region_display_name\" expr=\"context.display_name\" context=m49_country.m49_region/>\n	<@elem tag=\"m49_sub_region\" expr=\"context.id\" context=m49_country.m49_sub_region/>\n	<@elem tag=\"m49_sub_region_display_name\" expr=\"context.display_name\" context=m49_country.m49_sub_region/>\n	<@elem tag=\"m49_intermediate_region\" expr=\"context.id\" context=m49_country.m49_intermediate_region/>\n	<@elem tag=\"m49_intermediate_region_display_name\" expr=\"context.display_name\" context=m49_country.m49_intermediate_region/>\n	<@elem tag=\"country_development_status\" expr=\"context.development_status\" context=m49_country/>\n	<@elem tag=\"country_is_ldc\" expr=\"context.is_ldc\" type=\"Boolean\" context=m49_country/>\n	<@elem tag=\"country_is_lldc\" expr=\"context.is_lldc\" type=\"Boolean\" context=m49_country/>\n	<@elem tag=\"country_is_sids\" expr=\"context.is_sids\" type=\"Boolean\" context=m49_country/>\n</#if>\n	<@elem tag=\"placeSampled\" expr=\"gb_place_sampled\"/>\n	<@elem tag=\"earliestCollectionYear\" expr=\"earliest_collection_year\"/>\n	<@elem tag=\"latestCollectionYear\" expr=\"latest_collection_year\"/>\n<#if earliest_collection_year ?? || latest_collection_year ??>	\n<#if earliest_collection_year ?? && latest_collection_year ??>\n<#if earliest_collection_year == latest_collection_year>\n	<collectionYearRange>${renderProperty(\'earliest_collection_year\')}</collectionYearRange>\n<#else>\n	<collectionYearRange>${renderProperty(\'earliest_collection_year\')} to ${renderProperty(\'latest_collection_year\')}</collectionYearRange>\n</#if>\n<#else>\n<#if earliest_collection_year ??>	\n	<collectionYearRange>${renderProperty(\'earliest_collection_year\')} or later</collectionYearRange>\n<#else>\n	<collectionYearRange>${renderProperty(\'latest_collection_year\')} or earlier</collectionYearRange>\n</#if>\n</#if>\n</#if>\n	<@elem tag=\"length\" expr=\"gb_length\"/>\n	<@elem tag=\"rotation\" expr=\"rotation\"/>\n	<@elem tag=\"patentRelated\" expr=\"patent_related\" type=\"Boolean\"/>\n	<creationDate>${renderProperty(\'gb_create_date\')}</creationDate>\n	<updateDate>${renderProperty(\'gb_update_date\')}</updateDate>\n	<@elem tag=\"isolate\" expr=\"isolate\"/>\n	<@elem tag=\"host\" expr=\"host_species\"/>\n	<@elem tag=\"pubmedId\" expr=\"gb_pubmed_id\"/>\n</sequence>','hbvSequenceRenderer','hbvSequenceRenderer.ftlx'),('function rotateSequence(sequenceWhereClause) {\n	var fastaDocument;\n	glue.inMode(\"module/hbvFastaExporter\", function() {\n		fastaDocument = glue.command([\"export\", \"-w\", sequenceWhereClause, \"--preview\"]);\n	});\n	return rotateFastaDocument(fastaDocument);\n}\n\nfunction rotateFastaFile(fileName) {\n	var fastaDocument;\n	glue.inMode(\"module/hbvFastaUtility\", function() {\n		fastaDocument = glue.command([\"load-nucleotide-fasta\", fileName]);\n	});\n	return rotateFastaDocument(fastaDocument);\n}\n\nfunction rotateFastaDocument(fastaDocument) {\n	var rotationObjs = [];\n	_.each(fastaDocument.nucleotideFasta.sequences, function(seqObj) {\n		var seqID = seqObj.id;\n		var seqNts = seqObj.sequence;\n		\n		var startRegex = /AGT[TG]G[AG]A[GCT]TC[ACT][ATG]CAGC/;\n		\n		rotationObjs.push({\n			querySequenceId: seqID, \n			status: \"NO_ROTATION_NECESSARY\",\n			rotationNts: null\n		});\n	});\n	return rotationObjs;\n}','hbvSequenceRotator','hbvSequenceRotator.js'),('function visualiseFeatureAsSvg(document) {\n	var visualiseFeatureResult;\n	var outputFile = document.inputDocument.fileName;\n	delete document.inputDocument[\"fileName\"];\n	glue.inMode(\"module/hbvVisualisationUtility\", function() {\n		visualiseFeatureResult = glue.command({ \"visualise-feature\": document.inputDocument });\n	});\n	var transformResult;\n	glue.inMode(\"module/hbvFeatureToSvgTransformer\", function() {\n		transformResult = glue.command({ \"transform-to-web-file\": \n			{\n				\"webFileType\": \"WEB_PAGE\",\n				\"commandDocument\":{\n					transformerInput: {\n						featureVisualisation: visualiseFeatureResult.featureVisualisation,\n						ntWidth: 16\n					}\n				},\n				\"outputFile\": outputFile\n			}\n		});\n	});\n	return transformResult\n}','hbvSvgFeatureVisualisation','hbvSvgFeatureVisualisation.js'),('// simple recursive function to set treevisualiser-collapse to true on subtrees if \n// glueAlignmentName is set and the collapse flag is not already set.\nfunction collapseClades(subtree, foundAnyAlignment) {\n	var userData;\n	var subtreeType;\n	if(subtree.internal != null) { // internal node\n		userData = subtree.internal.userData;\n		subtreeType = \"internal\";\n	} else { // leaf node\n		userData = subtree.leaf.userData;\n		subtreeType = \"leaf\";\n	}\n	var alignmentNames = userData.glueAlignmentNames;\n	var recurse = true;\n	var nextFoundAnyAlignment = foundAnyAlignment;\n	var collapsed = userData[\"treevisualiser-collapsed\"];\n	if(subtreeType == \"leaf\" && userData[\"name\"].indexOf(\"ncbi-refseqs/\") > 0) {\n		userData[\"treevisualiser-leafSourceName\"] = \"ncbi-curated\";\n		userData[\"treevisualiser-leafSequenceID\"] = userData[\"name\"].substring(userData[\"name\"].lastIndexOf(\"/\")+1);\n	}\n	var mainAlignmentName;\n	if(collapsed == null) { // collapsed not already set to false\n		var collapsedLabel = \"\";\n		if(alignmentNames != null && alignmentNames.length > 0) {\n			mainAlignmentName = alignmentNames[0];\n			glue.inMode(\"alignment/\"+mainAlignmentName, function() {\n				collapsedLabel = glue.command([\"show\", \"property\", \"displayName\"]).propertyValueResult.value;\n			});\n			nextFoundAnyAlignment = true;\n		}\n		// don\'t collapse unassigned subtype leaf nodes\n		// don\'t collapse anything before you have found an alignment.\n		if(nextFoundAnyAlignment && subtreeType == \"internal\") { \n			userData[\"treevisualiser-collapsed\"] = \"true\";\n			userData[\"treevisualiser-collapsedLabel\"] = collapsedLabel;\n			if(mainAlignmentName != null) {\n				userData[\"treevisualiser-collapsedAlignment\"] = mainAlignmentName;\n			}\n			recurse = false;\n		}\n	}\n	if(subtreeType == \"internal\" && recurse) { // internal node\n		var branches = subtree.internal.branch;\n		_.each(branches, function(branch) {\n			collapseClades(branch, nextFoundAnyAlignment);\n		});\n	}\n}\n\nfunction visualisePhyloAsSvg(document) {\n	var glueTree;\n	\n	var queryName = document.inputDocument.queryName;\n	var placementIndex = document.inputDocument.placementIndex;\n	var maxNeighbours = null;\n	var maxDistance = document.inputDocument.maxDistance;\n	var placerResult = document.inputDocument.placerResult;\n	\n	// generate a tree for the placement, as a command document.\n	glue.inMode(\"module/hbvMaxLikelihoodPlacer\", function() {\n		glueTree = glue.command({\n				\"export\": {\n					\"placement-from-document\": {\n						\"phylogeny\": {\n							\"placerResultDocument\": placerResult,\n							\"placementIndex\": placementIndex,\n							\"queryName\": queryName, \n							\"leafName\": queryName\n						}\n					}\n				}\n		});\n	});\n\n	var neighbourObjs;\n\n	glue.inMode(\"module/hbvMaxLikelihoodPlacer\", function() {\n		neighbourObjs = glue.tableToObjects(glue.command({\n				\"list\": {\n					\"neighbour-from-document\": {\n						\"placerResultDocument\": placerResult,\n						\"placementIndex\": placementIndex,\n						\"queryName\": queryName, \n						\"maxNeighbours\": maxNeighbours, \n						\"maxDistance\": maxDistance\n					}\n				}\n		}));\n	});\n\n	var neighbourLeafNames = [queryName];\n\n	_.each(neighbourObjs, function(neighbourObj) {\n		neighbourLeafNames.push(\"alignment/\"+neighbourObj.alignmentName+\"/member/\"+neighbourObj.sourceName+\"/\"+neighbourObj.sequenceID);\n	});\n\n	glue.inMode(\"module/hbvPhyloUtility\", function() {\n		// suppress the collapse of any subtree which is an ancestor of the query leaf or its neighbours\n		glueTree = glue.command({\n			\"update-ancestor-subtrees\" : {\n				propertyName: \"treevisualiser-collapsed\",\n				propertyValue: \"false\",\n				leafNodeNames : neighbourLeafNames, \n				inputPhyloTree: glueTree\n			}\n		});\n		// set leaf node to highlighted\n		glueTree = glue.command({\n			\"update-leaves\" : {\n				propertyName: \"treevisualiser-highlighted\",\n				propertyValue: \"true\",\n				leafNodeNames : [queryName], \n				inputPhyloTree: glueTree\n			}\n		});\n		// set leaf node to non-member\n		glueTree = glue.command({\n			\"update-leaves\" : {\n				propertyName: \"treevisualiser-nonmember\",\n				propertyValue: \"true\",\n				leafNodeNames : [queryName], \n				inputPhyloTree: glueTree\n			}\n		});\n		// set ancestor branches of leaf node to highlighted\n		glueTree = glue.command({\n			\"update-ancestor-branches\" : {\n				propertyName: \"treevisualiser-highlighted\",\n				propertyValue: \"true\",\n				leafNodeNames : [queryName], \n				inputPhyloTree: glueTree\n			}\n		});\n	});\n\n	collapseClades(glueTree.phyloTree.root, false);\n\n	\n	// generate a visualisation document for the tree, \n	// with the visualisation maths etc. done\n	var visualiseTreeResult;\n\n	glue.inMode(\"module/hbvTreeVisualiser\", function() {\n		visualiseTreeResult = glue.command({\n			\"visualise\" : {\n				\"tree-document\": {\n					\"treeDocument\" : glueTree, \n					\"pxWidth\" : document.inputDocument.pxWidth, \n					\"pxHeight\" : document.inputDocument.pxHeight,\n					\"legendPxWidth\" : document.inputDocument.legendPxWidth, \n					\"legendPxHeight\" : document.inputDocument.legendPxHeight,\n					\"leafTextAnnotationName\": \"sequenceIDPlusClade\"\n				}\n			}\n		});\n	});\n\n	// from the visualisation documents, generate SVGs as GLUE web files.\n	var treeTransformResult;\n	glue.inMode(\"module/hbvTreeVisualisationTransformer\", function() {\n		treeTransformResult = glue.command({ \"transform-to-web-file\": \n			{\n				\"webFileType\": \"WEB_PAGE\",\n				\"commandDocument\":{\n					transformerInput: {\n						treeVisualisation: visualiseTreeResult.visDocument.treeVisualisation\n					}\n				},\n				\"outputFile\": document.inputDocument.fileName\n			}\n		});\n	});\n\n	var legendTransformResult;\n	glue.inMode(\"module/hbvTreeVisualisationLegendTransformer\", function() {\n		legendTransformResult = glue.command({ \"transform-to-web-file\": \n			{\n				\"webFileType\": \"WEB_PAGE\",\n				\"commandDocument\":{\n					transformerInput: {\n						treeVisualisationLegend: visualiseTreeResult.visDocument.treeVisualisationLegend\n					}\n				},\n				\"outputFile\": document.inputDocument.legendFileName\n			}\n		});\n	});\n\n	glue.logInfo(\"legendTransformResult\", legendTransformResult);\n	\n	return {\n		visualisePhyloAsSvgResult: {\n			treeTransformResult: treeTransformResult,\n			legendTransformResult: legendTransformResult\n		}\n	}\n}','hbvSvgPhyloVisualisation','hbvSvgPhyloVisualisation.js'),('<#setting number_format=\"####0.###\">\n<#assign legendVisDoc = transformerInput.treeVisualisationLegend>\n<#assign svgWidthPx = legendVisDoc.legendPxWidth>\n<#assign svgHeightPx = legendVisDoc.legendPxHeight>\n<#assign legendFontSize = legendVisDoc.legendFontSize>\n	\n<svg width=\"${svgWidthPx}\" height=\"${svgHeightPx}\"\n     xmlns=\"http://www.w3.org/2000/svg\">\n  <style>${getResourceAsString(\'hbvTreeVisualisationTransformer.css\')?no_esc}</style>\n  <g class=\"branchLengthLegendLine\">\n    <line\n	  	x1=\"${legendVisDoc.branchLengthLegendCentreLine.x1}\" \n	  	y1=\"${legendVisDoc.branchLengthLegendCentreLine.y1}\" \n	  	x2=\"${legendVisDoc.branchLengthLegendCentreLine.x2}\" \n	  	y2=\"${legendVisDoc.branchLengthLegendCentreLine.y2}\"/>\n    <#list legendVisDoc.branchLengthLegendTicks as branchLengthLegendTick>\n    <line\n	  	x1=\"${branchLengthLegendTick.x1}\" \n	  	y1=\"${branchLengthLegendTick.y1}\" \n	  	x2=\"${branchLengthLegendTick.x2}\" \n	  	y2=\"${branchLengthLegendTick.y2}\"/>\n    </#list>\n  </g>    \n  <g class=\"legendText\" font-size=\"${legendFontSize}\">\n  	<#list legendVisDoc.branchLengthLegendValues as branchLengthLegendValue>\n    <text\n	  	x=\"${branchLengthLegendValue.x}\"\n	  	y=\"${branchLengthLegendValue.y}\"\n	  	width=\"${branchLengthLegendValue.width}\" \n	  	height=\"${branchLengthLegendValue.height}\"\n	  	dy=\".35em\">${branchLengthLegendValue.text}</text>\n  	</#list>\n    <text\n	  	x=\"${legendVisDoc.branchLengthLegendUnits.x}\"\n	  	y=\"${legendVisDoc.branchLengthLegendUnits.y}\"\n	  	width=\"${legendVisDoc.branchLengthLegendUnits.width}\" \n	  	height=\"${legendVisDoc.branchLengthLegendUnits.height}\"\n	  	dy=\".35em\">${legendVisDoc.branchLengthLegendUnits.text}</text>\n  </g>\n</svg>\n','hbvTreeVisualisationLegendTransformer','hbvTreeVisualisationLegendTransformer.ftlh'),('svg {\n	font-family: Arial;\n}\n\n.branch {\n	stroke: DarkGrey;\n	stroke-width: 2px;\n	fill: none;\n}\n\n.branchLengthLegendLine {\n	stroke: DarkGrey;\n	stroke-width: 2px;\n}\n\n.highlightedBranch {\n	stroke: Red;\n	stroke-width: 2px;\n	fill: none;\n}\n\n.leafNode {\n	stroke: Black;\n	stroke-width: 1px;\n	fill: DarkGrey; \n}\n\n.highlightedLeafNode {\n	stroke: Black;\n	stroke-width: 1px;\n	fill: Red; \n}\n\n.leafText {\n	text-anchor: left;\n	fill: DarkGrey;\n}\n\n.leafLink:hover {\n	fill: Black;\n}\n\n\n.legendText {\n	text-anchor: left;\n	fill: DarkGrey;\n}\n\n.highlightedLeafText {\n	text-anchor: left;\n	fill: Red;\n}\n\n.collapsedSubtree {\n	stroke: url(#collapsedGrad);\n	stroke-width: 2px;\n	fill: url(#collapsedGrad); \n}\n\n.collapsedSubtreeText {\n	text-anchor: left;\n	fill: DarkGrey;\n}\n\n.collapsedSubtreeLink:hover {\n	fill: Black;\n}\n','hbvTreeVisualisationLegendTransformer','hbvTreeVisualisationTransformer.css'),('svg {\n	font-family: Arial;\n}\n\n.branch {\n	stroke: DarkGrey;\n	stroke-width: 2px;\n	fill: none;\n}\n\n.branchLengthLegendLine {\n	stroke: DarkGrey;\n	stroke-width: 2px;\n}\n\n.highlightedBranch {\n	stroke: Red;\n	stroke-width: 2px;\n	fill: none;\n}\n\n.leafNode {\n	stroke: Black;\n	stroke-width: 1px;\n	fill: DarkGrey; \n}\n\n.highlightedLeafNode {\n	stroke: Black;\n	stroke-width: 1px;\n	fill: Red; \n}\n\n.leafText {\n	text-anchor: left;\n	fill: DarkGrey;\n}\n\n.leafLink:hover {\n	fill: Black;\n}\n\n\n.legendText {\n	text-anchor: left;\n	fill: DarkGrey;\n}\n\n.highlightedLeafText {\n	text-anchor: left;\n	fill: Red;\n}\n\n.collapsedSubtree {\n	stroke: url(#collapsedGrad);\n	stroke-width: 2px;\n	fill: url(#collapsedGrad); \n}\n\n.collapsedSubtreeText {\n	text-anchor: left;\n	fill: DarkGrey;\n}\n\n.collapsedSubtreeLink:hover {\n	fill: Black;\n}\n','hbvTreeVisualisationTransformer','hbvTreeVisualisationTransformer.css'),('<#setting number_format=\"####0.###\">\n<#assign treeVisDoc = transformerInput.treeVisualisation>\n<#assign svgWidthPx = treeVisDoc.pxWidth>\n<#assign svgHeightPx = treeVisDoc.pxHeight>\n<#assign verticalLeafSpacePx = treeVisDoc.verticalLeafSpacePx>\n<#assign leafTextGapPx = treeVisDoc.leafTextGapPx>\n<#assign leafTextFontSize = treeVisDoc.leafTextFontSize>\n	\n<#assign leafNodeRadiusPx = 2>\n	\n<svg width=\"${svgWidthPx}\" height=\"${svgHeightPx}\"\n     xmlns=\"http://www.w3.org/2000/svg\">\n  <style>${getResourceAsString(\'hbvTreeVisualisationTransformer.css\')?no_esc}</style>\n  <linearGradient id=\"collapsedGrad\" x1=\"0%\" y1=\"0%\" x2=\"100%\" y2=\"0%\">\n    <stop offset=\"0%\" style=\"stop-color:DarkGrey;stop-opacity:1\" />\n    <stop offset=\"60%\" style=\"stop-color:DarkGrey;stop-opacity:1\" />\n    <stop offset=\"100%\" style=\"stop-color:White;stop-opacity:1\" />\n  </linearGradient>  \n  <g class=\"branch\">\n  <polyline points=\"${treeVisDoc.root.x1} ${treeVisDoc.root.y1}, ${treeVisDoc.root.x2} ${treeVisDoc.root.y2}\"/>\n  <#list treeVisDoc.branches as branch>\n    <polyline <#if branch.highlighted!false>class=\"highlightedBranch\"</#if>\n		points=\"${branch.parentX} ${branch.parentY}, ${branch.cornerX} ${branch.cornerY}, ${branch.childX} ${branch.childY}\"/>\n  </#list>\n  </g>\n  <g class=\"leafNode\">\n  <#list treeVisDoc.leafNodes as leafNode>\n    <circle <#if leafNode.highlighted!false>class=\"highlightedLeafNode\"</#if>\n    	cx=\"${leafNode.x}\" cy=\"${leafNode.y}\" r=\"${leafNodeRadiusPx}\"/>\n  </#list>\n  </g>\n  <g font-size=\"${leafTextFontSize}\">\n  <#list treeVisDoc.leafNodes as leafNode>\n    <#if leafNode.properties.leafSourceName ?? && leafNode.properties.leafSequenceID ?? >\n	<a class=\"leafLink\" href=\"#project/sequence/${leafNode.properties.leafSourceName}/${leafNode.properties.leafSequenceID}\" target=\"_blank\">\n	</#if>\n    <text <#if leafNode.highlighted!false>class=\"highlightedLeafText\"<#else>class=\"leafText\"</#if>\n	  	x=\"${leafNode.x+leafTextGapPx}\" y=\"${leafNode.y}\" width=\"${leafNode.properties.leafTextWidthPx}\" height=\"${verticalLeafSpacePx}\"\n	  	dy=\".35em\">${leafNode.properties.leafText}</text>\n    <#if leafNode.properties.leafSourceName ?? && leafNode.properties.leafSequenceID ?? >\n	</a>\n	</#if>\n  </#list>\n  </g>\n  <#if treeVisDoc.collapsedSubtrees??>\n  <g class=\"collapsedSubtree\">\n  <#list treeVisDoc.collapsedSubtrees as collapsedSubtree>\n	<#assign bezierPointXOffsetPx = ((collapsedSubtree.leafX - collapsedSubtree.rootX) * 0.5)>\n    <path\n		d=\"M ${collapsedSubtree.rootX} ${collapsedSubtree.rootY}\n		C ${collapsedSubtree.rootX + bezierPointXOffsetPx} ${collapsedSubtree.rootY}\n		  ${collapsedSubtree.leafX - bezierPointXOffsetPx} ${collapsedSubtree.upperLeafY} \n		  ${collapsedSubtree.leafX} ${collapsedSubtree.upperLeafY} \n		L ${collapsedSubtree.leafX} ${collapsedSubtree.lowerLeafY} \n		C ${collapsedSubtree.leafX - bezierPointXOffsetPx} ${collapsedSubtree.lowerLeafY}\n		  ${collapsedSubtree.rootX + bezierPoint