n#titleAndOverview {\n	float: left;\n	width: 50%;\n	padding-bottom: 100%;\n    margin-bottom: -100%;\n}\n\n#overview {\n    width:90%;\n}\n\n#systemConfigTable {\n    width:50%;\n}\n\n\n#logos {\n	float: left;\n	width: 50%;\n	text-align: right;\n	padding-bottom: 100%;\n    margin-bottom: -100%;\n}\n\n#cvrLogo {\n	display: inline-block;\n	height:160px;	\n}\n','hdrRasReportTransformer','hdrRasReportTransformer.css'),('<html>\n<head>\n<meta charset=\"UTF-8\">\n<style>\n${getResourceAsString(\'hdrRasReportTransformer.css\')?no_esc}\n</style>\n</head>\n<body>\n\n\n<div id=\"block1\">\n<div id=\"titleAndOverview\">\n<h2>Hepatitis B virus sequence report</h2>\n\n<p>\n	THIS FUNCTIONALITY IS PURELY FOR DEMONSTRATION PURPOSES AND SHOULD NOT IN ANY WAY BE USED IN A PUBLIC HEALTH, MEDICAL OR CLINICAL CONTEXT.		\n</p>\n\n<table id=\"overview\">\n<colgroup>\n    <col class=\"tableHeader\"/>\n    <col/>\n</colgroup>\n\n<tr><td><b>File path</b></td><td>${hbvReport.filePath}</td></tr>\n<tr><td><b>Sequance data format</b></td><td>\n<#if hbvReport.sequenceDataFormat = \"FASTA\"> \nConsensus (FASTA)\n</#if>\n</td></tr>\n<#if hbvReport.sequenceDataFormat = \"FASTA\"> \n<tr>\n<td><b>Sequence ID</b></td>\n<td>${hbvReport.sequenceResult.id}</td>\n</tr>\n</#if>\n<tr><td><b>Report generation date</b></td><td>${hbvReport.reportGenerationDate}</td></tr>\n</table>\n\n</div>\n<div id=\"logos\">\n<img id=\"cvrLogo\" alt=\"CVR logo\" src=\"data:image/svg+xml;base64,${getResourceAsBase64(\'cvrLogo.svg\')}\" />\n</div>\n</div>\n\n\n\n\n<#assign pubIdToIdx = {}>\n<#assign pubIdToPubHash = {}>\n<#assign nextPubIdx = 1>\n\n<#assign sequenceResult = hbvReport.sequenceResult>\n<p>\n<h4>Sequence classification</h4>\n<table>\n<colgroup>\n    <col class=\"tableHeader\"/>\n    <col/>\n</colgroup>\n\n<tr>\n<td><b>Sequence identified as HBV?</b></td>\n<#if sequenceResult.isForwardHbv>\n<td>Yes</td>\n<#else>\n<td>No</td>\n</#if>\n</tr>\n<tr>\n<td><b>Rightward nucleotide rotation</b></td>\n<#if sequenceResult.rotationSuccess>\n<#if sequenceResult.rotationStatus = \'ROTATION_NECESSARY\'>\n<td>${sequenceResult.rotationNts?c}</td>\n<#else>\n<td>No rotation necessary</td>\n</#if>\n<#else>\n<td>Unknown</td>\n</#if>\n</tr>\n\n\n<tr>\n<td><b>Genotype</b></td>\n<#if sequenceResult.genotypingResult?? && sequenceResult.genotypingResult.genotypeCategoryResult??>\n<td>${sequenceResult.genotypingResult.genotypeCategoryResult.shortRenderedName?replace(\'Genotype \', \'\')}</td>\n<#else>\n<td>Unknown</td>\n</#if>\n</tr>\n\n<tr>\n<td><b>Subgenotype</b></td>\n<#if sequenceResult.genotypingResult?? && sequenceResult.genotypingResult.subgenotypeCategoryResult??>\n<td>${sequenceResult.genotypingResult.subgenotypeCategoryResult.shortRenderedName?replace(\'Subgenotype \', \'\')}</td>\n<#else>\n<td>Unknown</td>\n</#if>\n</tr>\n\n\n</table>\n</p>\n\n<div class=\"pagebreak\"> </div>\n\n\n<p>\n<h4>Antiviral drug resistance</h4>\n<#if sequenceResult.antiviralResistance?? && sequenceResult.antiviralResistance?size gt 0>\n<table>\n<tr class=\"tableHeader\">\n  <td><b>Virus protein</b></td>\n  <td><b>Resistant pattern</b></td>\n  <td><b>Detected pattern</b></td>\n  <td><b>Resisted drug</b></td>\n  <td><b>Genotypes</b></td>\n  <td><b>References</b></td>\n</tr>\n<#list sequenceResult.antiviralResistance as substitution>\n<tr>\n<td>${substitution.virusDomainDisplayName}</td>\n<td>${substitution.description}</td>\n<td>${substitution.detectedPattern}</td>\n<td>\n${substitution.drug.name} (${substitution.drug.abbreviatedName})\n</td>\n<td>\n<#list substitution.clade as clade>\n<#if clade.name = \'AL_MASTER\'>All genotypes<#else>${clade.displayName?replace(\'Genotype \', \'\')}</#if><#if !clade?is_last>,</#if>\n</#list>\n</td>\n<td>\n<#list substitution.publication as publication>\n<#if pubIdToIdx[publication.id]??>\n<#assign pubIndex = pubIdToIdx[publication.id]>\n<#else>\n<#assign pubIndex = nextPubIdx>\n<#assign pubIdToIdx = pubIdToIdx+{publication.id: pubIndex}>\n<#assign pubIdToPubHash = pubIdToPubHash+{publication.id: publication}>\n<#assign nextPubIdx = nextPubIdx+1>\n</#if>\n<a target=\"_blank\" href=\"${publication.url}\">${publication.authorsShort} ${publication.year}</a> [${pubIndex}]<#if !publication?is_last>,</#if>\n</#list>\n</td>\n</tr>\n</#list>\n</table>\n<#else>\n<#if sequenceResult.antiviralResistance??>\nNo resistant substitutions found\n<#else>\nNo resistance scan was performed\n</#if>\n</#if>\n</p>\n\n<div class=\"pagebreak\"> </div>\n\n<p>\n<h4>Vaccine escape</h4>\n<#if sequenceResult.vaccineEscape?? && sequenceResult.vaccineEscape?size gt 0>\n<table>\n<tr class=\"tableHeader\">\n  <td><b>Virus protein</b></td>\n  <td><b>Escape pattern</b></td>\n  <td><b>Detected pattern</b></td>\n  <td><b>Genotypes</b></td>\n  <td><b>References</b></td>\n</tr>\n<#list sequenceResult.vaccineEscape as substitution>\n<tr>\n<td>${substitution.virusDomainDisplayName}</td>\n<td>${substitution.description}</td>\n<td>${substitution.detectedPattern}</td>\n<td>\n<#list substitution.clade as clade>\n<#if clade.name = \'AL_MASTER\'>All genotypes<#else>${clade.displayName?replace(\'Genotype \', \'\')}</#if><#if !clade?is_last>,</#if>\n</#list>\n</td>\n<td>\n<#list substitution.publication as publication>\n<#if pubIdToIdx[publication.id]??>\n<#assign pubIndex = pubIdToIdx[publication.id]>\n<#else>\n<#assign pubIndex = nextPubIdx>\n<#assign pubIdToIdx = pubIdToIdx+{publication.id: pubIndex}>\n<#assign pubIdToPubHash = pubIdToPubHash+{publication.id: publication}>\n<#assign nextPubIdx = nextPubIdx+1>\n</#if>\n<a target=\"_blank\" href=\"${publication.url}\">${publication.authorsShort} ${publication.year}</a> [${pubIndex}]<#if !publication?is_last>,</#if>\n</#list>\n</td>\n</tr>\n</#list>\n</table>\n<#else>\n<#if sequenceResult.vaccineEscape??>\nNo vaccine escape mutations found\n<#else>\nNo vaccine escape scan was performed\n</#if>\n</#if>\n</p>\n\n<div class=\"pagebreak\"> </div>\n\n<#if pubIdToIdx?size gt 0>\n<h4>References</h4>\n<small>\n<#list pubIdToIdx as pubId, pubIdx>\n<#assign publication = pubIdToPubHash[pubId]>\n<p>\n[${pubIdx}] \n<b>${publication.title}</b>\n<br/>\n${publication.authorsFull}, \n${publication.journal}\n<#if publication.volume?? && publication.issue??>\n	${publication.volume}(${publication.issue}),\n<#elseif publication.volume??>\n	${publication.volume},\n</#if>\n<#if publication.pages??>\n	${publication.pages}\n</#if>\n(${publication.year})\n<br/>\n<a target=\"_blank\" href=\"${publication.url}\">${publication.url}</a> \n</p>\n</#list>\n</small>\n</#if>\n\n<div class=\"pagebreak\"> </div>\n\n<div id=\"configuration\">\n<h4>System configuration</h4>\n<table id=\"systemConfigTable\">\n<colgroup style=\"width:50%\">\n    <col class=\"tableHeader\"/>\n</colgroup>\n<colgroup style=\"width:50%\">\n    <col/>\n</colgroup>\n<tr><td><b>GLUE engine version</b></td><td>${hbvReport.engineVersion}</td></tr>\n<tr><td><b>HBV project version</b></td><td>${hbvReport.projectVersion}</td></tr>\n<tr><td><b>Drug resistance / vaccine escape extension version</b></td><td>${hbvReport.extensionVersion}</td></tr>\n</table>\n</div>\n\n\n</body>\n</html>','hdrRasReportTransformer','hdrRasReportTransformer.ftlh'),('<#include \"/utils/glueDocUtils.ftlx\">\n<hdrRasVariation>\n	<virusDomain>${featureLoc.feature.name}</virusDomain>\n	<virusDomainDisplayName>${featureLoc.feature.displayName}</virusDomainDisplayName>\n	<description>${description}</description>\n	<drug glueType=\"Object\">\n		<name>${hdr_ras.hdr_drug.id}</name>\n		<abbreviatedName>${hdr_ras.hdr_drug.abbreviated_name}</abbreviatedName>\n	</drug>\n	<#list hdr_ras.hdr_ras_alignment as ras_alignment>\n	<clade glueType=\"Object[]\">\n		<name>${ras_alignment.alignment.name}</name>\n		<displayName>${ras_alignment.alignment.displayName}</displayName>\n	</clade>\n	</#list>\n	<#list hdr_ras.hdr_ras_publication as ras_publication>\n	<publication glueType=\"Object[]\">\n		<id>${ras_publication.hdr_publication.id}</id>\n		<title>${ras_publication.hdr_publication.title}</title>\n		<authorsShort>${ras_publication.hdr_publication.authors_short}</authorsShort>\n		<authorsFull>${ras_publication.hdr_publication.authors_full}</authorsFull>\n		<year>${ras_publication.hdr_publication.year?c}</year>\n		<journal>${ras_publication.hdr_publication.journal}</journal>\n		<volume>${ras_publication.hdr_publication.volume}</volume>\n		<@elem tag=\"issue\" expr=\"context.issue\" context=ras_publication.hdr_publication/>\n		<@elem tag=\"pages\" expr=\"context.pages\" context=ras_publication.hdr_publication/>\n		<url>${ras_publication.hdr_publication.url}</url>\n	</publication>\n	</#list>\n	\n</hdrRasVariation>','hdrRasVariationRenderer','hdrRasVariationRenderer.ftlx'),('\n\n\nfunction reportFastaWeb(base64, filePath) {\n	glue.log(\"FINE\", \"hdrReportingController.reportFastaWeb invoked\");\n	var fastaDocument;\n	glue.inMode(\"module/hbvFastaUtility\", function() {\n		fastaDocument = glue.command([\"base64-to-nucleotide-fasta\", base64]);\n	});\n	var numSequencesInFile = fastaDocument.nucleotideFasta.sequences.length;\n	if(numSequencesInFile == 0) {\n		throw new Error(\"No sequences found in FASTA file\");\n	}\n	var maxSequencesWithoutAuth = 50;\n	if(numSequencesInFile > maxSequencesWithoutAuth && !glue.hasAuthorisation(\"hbvFastaAnalysisLargeSubmissions\")) {\n		throw new Error(\"Not authorised to analyse FASTA files with more than \"+maxSequencesWithoutAuth+\" sequences\");\n	}\n	\n	var hdrResult;\n	glue.inMode(\"module/hbvReportingController\", function() {\n		hdrResult = glue.command({\n			\"invoke-function\": {\n				\"functionName\": \"reportDocument\",\n				\"document\": {\n					\"reportFastaDocument\": {\n						\"fastaDocument\": fastaDocument, \n						\"filePath\": filePath\n					}\n				}\n\n			}\n		});\n	});\n	var extensionVersion = \n		glue.command([\"show\",\"extension-setting\",\"hdr\",\"extension-version\"]).projectShowExtensionSettingResult.extSettingValue;\n\n	var fastaMap = {};\n	_.each(fastaDocument.nucleotideFasta.sequences, function(seqObj) {fastaMap[seqObj.id] = seqObj;});\n	var resultMap = {};\n	var i = 0;\n	_.each(hdrResult.hbvWebReport.results, \n			function(hbvResultObj) {\n				resultMap[hbvResultObj.hbvReport.sequenceResult.id] = hbvResultObj.hbvReport.sequenceResult;\n				hbvResultObj.hbvReport.extensionVersion = extensionVersion;\n			});\n	_.each(_.values(fastaMap), function(seqObj) {\n		var resultObj = resultMap[seqObj.id];\n		\n		if(resultObj.isForwardHbv && resultObj.rotationSuccess && resultObj.genotypingResult != null && resultObj.genotypingResult.genotypeCategoryResult != null ) {\n			var sequenceNts = seqObj.sequence;\n			if(resultObj.rotationStatus == \"ROTATION_NECESSARY\") {\n				sequenceNts = rightRotate(sequenceNts, resultObj.rotationNts);\n			}\n			drugResistanceScan(sequenceNts, resultObj, resultObj.genotypingResult.genotypeCategoryResult.finalClade);\n		}\n		i++;\n		glue.setRunningDescription(\"Scanned for drug resistance \"+i+\"/\"+numSequencesInFile+\" sequence\"+((numSequencesInFile > 1) ? \"s\" : \"\"));\n	});\n	i = 0;\n	_.each(_.values(fastaMap), function(seqObj) {\n		var resultObj = resultMap[seqObj.id];\n		if(resultObj.isForwardHbv && resultObj.rotationSuccess && resultObj.genotypingResult != null && resultObj.genotypingResult.genotypeCategoryResult != null) {\n			var sequenceNts = seqObj.sequence;\n			if(resultObj.rotationStatus == \"ROTATION_NECESSARY\") {\n				sequenceNts = rightRotate(sequenceNts, resultObj.rotationNts);\n			}\n			vaccineEscapeScan(sequenceNts, resultObj, resultObj.genotypingResult.genotypeCategoryResult.finalClade);\n		}\n		i++;\n		glue.setRunningDescription(\"Scanned for vaccine escape \"+i+\"/\"+numSequencesInFile+\" sequence\"+((numSequencesInFile > 1) ? \"s\" : \"\"));\n	});\n	\n\n	glue.log(\"FINE\", \"hdrReportingController.reportFastaWeb result\", hdrResult);\n	glue.setRunningDescription(\"Collating report\");\n	return hdrResult;\n}\n\nfunction drugResistanceScan(sequenceNts, sequenceResult, genotypeAlmtName) {\n	var sequenceID = sequenceResult.id;\n	var rasVariationMatchDocument;\n	glue.inMode(\"module/hbvFastaSequenceReporter\", function() {\n\n		rasVariationMatchDocument = glue.command([\"string\", \"variation\", \"scan\", \n			\"--fastaString\", sequenceNts,\n			\"--relRefName\", \"REF_NUMBERING_X02763\", \n			\"--featureName\", \"RT\",\n			\"--targetRefName\", sequenceResult.targetRefName, \n			\"--linkingAlmtName\", \"AL_UNCONSTRAINED\", \n			\"--whereClause\", \"hdr_ras.hdr_ras_alignment.alignment.name in (\'AL_MASTER\', \'\"+genotypeAlmtName+\"\')\", \n			\"--excludeAbsent\",\n			\"--showMatchesAsDocument\"]);\n		//glue.logInfo(\"rasVariationMatchDocument\", rasVariationMatchDocument);\n\n	});\n	sequenceResult.antiviralResistance = _.map(rasVariationMatchDocument.variationScanMatchCommandResult.variations, function(matchObj) {\n		var renderedRasDoc;\n		glue.inMode(\"reference/REF_NUMBERING_X02763/feature-location/RT/variation/\"+matchObj.variationName, function() {\n			renderedRasDoc = glue.command([\"render-object\", \"hdrRasVariationRenderer\"]).hdrRasVariation;\n			if(matchObj.variationType == \'aminoAcidRegexPolymorphism\') {\n				renderedRasDoc.detectedPattern = matchObj.matches[0].firstRefCodon + matchObj.matches[0].queryAAs;\n			} else if(matchObj.variationType == \'conjunction\') {\n				var conjunctMatches = matchObj.matches[0].conjuncts;\n				renderedRasDoc.detectedPattern = \"\";\n				for(var i = 0; i < conjunctMatches.length; i++) {\n					if(i > 0) {\n						renderedRasDoc.detectedPattern +=\"+\";\n					}\n					renderedRasDoc.detectedPattern += conjunctMatches[i].matches[0].firstRefCodon + conjunctMatches[i].matches[0].queryAAs;\n				}\n			} else {\n				throw new Error(\"Unable to handle variationType \"+matchObj.variationType);\n			}\n		});	\n		return renderedRasDoc;\n	});\n}\n\n//rotates s towards left by d  \nfunction leftRotate(str, d) { \n	return str.slice(d) + str.slice(0, d); \n} \n\n// rotates s towards right by d  \nfunction rightRotate(str, d) { \n	return leftRotate(str, str.length() - d); \n}\n\nfunction vaccineEscapeScan(sequenceNts, sequenceResult, genotypeAlmtName) {\n	var sequenceID = sequenceResult.id;\n	_.each([\"S\", \"PRE_S1\"], function(featureName) {\n\n		var vemVariationMatchDocument;\n		glue.inMode(\"module/hbvFastaSequenceReporter\", function() {\n\n			vemVariationMatchDocument = glue.command([\"string\", \"variation\", \"scan\", \n				\"--fastaString\", sequenceNts,\n				\"--relRefName\", \"REF_NUMBERING_X02763\", \n				\"--featureName\", featureName,\n				\"--targetRefName\", sequenceResult.targetRefName, \n				\"--linkingAlmtName\", \"AL_UNCONSTRAINED\", \n				\"--whereClause\", \"hdr_vem.hdr_vem_alignment.alignment.name in (\'AL_MASTER\', \'\"+genotypeAlmtName+\"\')\", \n				\"--excludeAbsent\",\n				\"--showMatchesAsDocument\"]);\n			// glue.logInfo(\"vemVariationMatchDocument\", vemVariationMatchDocument);\n\n		});\n		if(sequenceResult.vaccineEscape == null) {\n			sequenceResult.vaccineEscape = [];\n		}\n		_.each(vemVariationMatchDocument.variationScanMatchCommandResult.variations, function(matchObj) {\n			var renderedVemDoc;\n			glue.inMode(\"reference/REF_NUMBERING_X02763/feature-location/\"+featureName+\"/variation/\"+matchObj.variationName, function() {\n				renderedVemDoc = glue.command([\"render-object\", \"hdrVemVariationRenderer\"]).hdrVemVariation;\n				if(matchObj.variationType == \'aminoAcidRegexPolymorphism\') {\n					renderedVemDoc.detectedPattern = matchObj.matches[0].firstRefCodon + matchObj.matches[0].queryAAs;\n				} else if(matchObj.variationType == \'conjunction\') {\n					var conjunctMatches = matchObj.matches[0].conjuncts;\n					renderedVemDoc.detectedPattern = \"\";\n					for(var i = 0; i < conjunctMatches.length; i++) {\n						if(i > 0) {\n							renderedVemDoc.detectedPattern +=\"+\";\n						}\n						renderedVemDoc.detectedPattern += conjunctMatches[i].matches[0].firstRefCodon + conjunctMatches[i].matches[0].queryAAs;\n					}\n				} else {\n					throw new Error(\"Unable to handle variationType \"+matchObj.variationType);\n				}\n			});	\n			sequenceResult.vaccineEscape.push(renderedVemDoc);\n		});\n\n	});\n	\n}\n\n//### CLI Usage\n\nfunction reportFastaCli(filePath) {\n  glue.log(\"FINE\", \"hdrReportingController.reportFastaCli invoked, filePath=\"+filePath);\n\n  // 1) read nucleotide FASTA from a file path\n  var fastaDocument;\n  glue.inMode(\"module/hbvFastaUtility\", function() {\n    // If hbvFastaUtility already has something like this, use it.\n    // Common names in GLUE utilities are \"load-nucleotide-fasta\" / \"import-nucleotide-fasta\" style.\n    fastaDocument = glue.command([\"load-nucleotide-fasta\", filePath]);\n  });\n\n  // 2) reuse the same machinery as reportFastaWeb\n  return reportFastaDocumentCommon(fastaDocument, filePath);\n}\n\nfunction reportFastaDocumentCommon(fastaDocument, filePath) {\n  var numSequencesInFile = fastaDocument.nucleotideFasta.sequences.length;\n  if(numSequencesInFile == 0) throw new Error(\"No sequences found in FASTA file\");\n\n  var hdrResult;\n  glue.inMode(\"module/hbvReportingController\", function() {\n    hdrResult = glue.command({\n      \"invoke-function\": {\n        \"functionName\": \"reportDocument\",\n        \"document\": {\n          \"reportFastaDocument\": { \"fastaDocument\": fastaDocument, \"filePath\": filePath }\n        }\n      }\n    });\n  });\n\n  var extensionVersion =\n    glue.command([\"show\",\"extension-setting\",\"hdr\",\"extension-version\"])\n      .projectShowExtensionSettingResult.extSettingValue;\n\n  var fastaMap = {};\n  _.each(fastaDocument.nucleotideFasta.sequences, function(seqObj) { fastaMap[seqObj.id] = seqObj; });\n\n  var resultMap = {};\n  _.each(hdrResult.hbvWebReport.results, function(hbvResultObj) {\n    resultMap[hbvResultObj.hbvReport.sequenceResult.id] = hbvResultObj.hbvReport.sequenceResult;\n    hbvResultObj.hbvReport.extensionVersion = extensionVersion;\n  });\n\n  var i = 0;\n  _.each(_.values(fastaMap), function(seqObj) {\n    var resultObj = resultMap[seqObj.id];\n    if(resultObj && resultObj.isForwardHbv && resultObj.rotationSuccess &&\n       resultObj.genotypingResult && resultObj.genotypingResult.genotypeCategoryResult) {\n\n      var sequenceNts = seqObj.sequence;\n      if(resultObj.rotationStatus == \"ROTATION_NECESSARY\") {\n        sequenceNts = rightRotate(sequenceNts, resultObj.rotationNts);\n      }\n      drugResistanceScan(sequenceNts, resultObj, resultObj.genotypingResult.genotypeCategoryResult.finalClade);\n    }\n    i++;\n    glue.setRunningDescription(\"Scanned for drug resistance \"+i+\"/\"+numSequencesInFile);\n  });\n\n  i = 0;\n  _.each(_.values(fastaMap), function(seqObj) {\n    var resultObj = resultMap[seqObj.id];\n    if(resultObj && resultObj.isForwardHbv && resultObj.rotationSuccess &&\n       resultObj.genotypingResult && resultObj.genotypingResult.genotypeCategoryResult) {\n\n      var sequenceNts = seqObj.sequence;\n      if(resultObj.rotationStatus == \"ROTATION_NECESSARY\") {\n        sequenceNts = rightRotate(sequenceNts, resultObj.rotationNts);\n      }\n      vaccineEscapeScan(sequenceNts, resultObj, resultObj.genotypingResult.genotypeCategoryResult.finalClade);\n    }\n    i++;\n    glue.setRunningDescription(\"Scanned for vaccine escape \"+i+\"/\"+numSequencesInFile);\n  });\n\n  return hdrResult;\n}\n','hdrReportingController','hdrReportingController.js'),('<#include \"/utils/glueDocUtils.ftlx\">\n<hdrVemVariation>\n	<virusDomain>${featureLoc.feature.name}</virusDomain>\n	<virusDomainDisplayName>${featureLoc.feature.displayName}</virusDomainDisplayName>\n	<description>${description}</description>\n	<#list hdr_vem.hdr_vem_alignment as vem_alignment>\n	<clade glueType=\"Object[]\">\n		<name>${vem_alignment.alignment.name}</name>\n		<displayName>${vem_alignment.alignment.displayName}</displayName>\n	</clade>\n	</#list>\n	<#list hdr_vem.hdr_vem_publication as vem_publication>\n	<publication glueType=\"Object[]\">\n		<id>${vem_publication.hdr_publication.id}</id>\n		<title>${vem_publication.hdr_publication.title}</title>\n		<authorsShort>${vem_publication.hdr_publication.authors_short}</authorsShort>\n		<authorsFull>${vem_publication.hdr_publication.authors_full}</authorsFull>\n		<year>${vem_publication.hdr_publication.year?c}</year>\n		<journal>${vem_publication.hdr_publication.journal}</journal>\n		<volume>${vem_publication.hdr_publication.volume}</volume>\n		<@elem tag=\"issue\" expr=\"context.issue\" context=vem_publication.hdr_publication/>\n		<@elem tag=\"pages\" expr=\"context.pages\" context=vem_publication.hdr_publication/>\n		<url>${vem_publication.hdr_publication.url}</url>\n	</publication>\n	</#list>\n	\n</hdrVemVariation>','hdrVemVariationRenderer','hdrVemVariationRenderer.ftlx'),('<#include \"/utils/glueDocUtils.ftlx\">\n<m49Region>\n	<id>${id}</id>\n	<displayName>${display_name}</displayName>\n	<#list m49_sub_region as subRegion>\n    <m49SubRegion glueType=\"Object[]\">\n		<id>${subRegion.id}</id>\n		<displayName>${subRegion.display_name}</displayName>\n		<#list subRegion.m49_intermediate_region as intermediateRegion>\n	    <m49IntermediateRegion glueType=\"Object[]\">\n			<id>${intermediateRegion.id}</id>\n			<displayName>${intermediateRegion.display_name}</displayName>\n	    </m49IntermediateRegion>\n	    </#list>\n    </m49SubRegion>\n    </#list>\n</m49Region>','m49RegionTreeRenderer','m49RegionTreeRenderer.ftlx');
